import "./ExpenseItem.css";

const ExpenseDate = ({ date: expenseDate }) => {
  const [day, month, year] = [
    expenseDate.getDate(),
    expenseDate.toLocaleString("default", { month: "long" }),
    expenseDate.getFullYear(),
  ];

  return (
    <div>
      <div>{month}</div>
      <div>{year}</div>
      <div>{day}</div>
    </div>
  );
};

export default ExpenseDate;
